import {BrowserRouter as Router, Routes, Route} from 'react-router-dom' ;
import 'bootstrap/dist/css/bootstrap.min.css' ;

import AddIncident from "./Components/AddIncident.component"
import RenderIncident from "./Components/RenderIncident.component"
import Result from "./Components/Result.component"

function App() {
  const redirectToInternalPage = () => {

    window.location.href = 'front\public\mymapNew.html';
  };
  return (
    <Router>
      <div className="container">


      <AddIncident />
      <RenderIncident />
      <button onClick={redirectToInternalPage} target="_blank">Visit Map</button>
      <a className='navbar-brand' href="front\public\mymapNew.html" target="_blank"  rel="noreferrer"> <img src="./Melkart.png.png" style={{width:"100px", height:"100px"}} alt='JE' /> </a>   
      </div>
    </Router>
  );
}

export default App;
